import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
 var name = "wendy";
var presentation = <h2>hola soy {name}</h2>



  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hola Mundo.
        </p>
     {presentation}

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
